INSERT INTO `broadcast` VALUES ('1', 'fb943c59-290e-4b82-b741-71a4f0072a97', '2016-03-07 16:56:16', '2016-07-13 13:12:03', '兰克直播编辑', 'lankezhibobianji', '41', '<p>直播测试八年</p>', 'http://live.vhdong.com/Home/LoginAPI?cid=209&url=wtzg', '<p>2016年是“十三五”开局之年，十八届五中全会提出2020年全面建成小康社会总目标，所谓“小康社会”，是包括贫困地区的全国人民的小康。党的十八大以来，习近平总书记考察的贫困地区有十几个，河北、甘肃、湖南、云南……习近平总书记常会出现在最贫困的地方，询饥饱、问冷暖、恤困苦。接下来，我们对总书记历次考察过的贫困村进行梳理，看看总书记去过的贫困村如今怎么样。</p><p>　　一</p><p>　　2012年12月29日至30日，中共中央总书记、中央军委主席习近平在河北省阜平县龙泉关镇骆驼湾村、顾家台村看望慰问困难群众，考察扶贫工作。阜平县山多、水少、耕地少，这两个行政村村民年人均收入分别是950元和980元，远远低于国家年人均收入贫困线标准的2300元，在骆驼湾村608口人中，428人为贫困人口。</p><p>　　<strong>习近平在考察过程中强调，只要有信心，石头也能变成金。没有农村的小康，特别是没有贫困地区的小康，就不可能全面建成小康社会。一定要想方设法尽快让乡亲们过上好日子。</strong></p><p style=\"text-align:center;\"><img style=\"WIDTH: 500px\" src=\"http://www.chinanews.com/cr/2016/0307/339220533.jpg\"/></p><p>　　2012年12月29日至30日，中共中央总书记、中央军委主席习近平在河北省阜平县看望慰问困难群众。这是习近平在龙泉关镇骆驼湾村到困难群众唐荣斌家看望。（新华社记者 \r\n兰红光 摄）</p><p>　　距离习近平总书记调研阜平县已经三年，阜平，也因此成为中国扶贫新的地标和样本。在那之后，国务院扶贫办成立“燕山-太行山片区阜平试点”协调小组,河北省专门针对阜平成立了扶贫攻坚领导小组。国家部委把阜平作为特别帮扶对象，阜平获批了省级经济开发区，投入1600万元搞基础建设，仅在2013一年，　阜平就接收各级专项资金12.61亿元，是当地财政收入的7倍，并且唐山、廊坊等几个兄弟城市对阜平进行对口帮扶。</p><p style=\"text-align:center;\"><img style=\"WIDTH: 500px\" src=\"http://www.chinanews.com/cr/2016/0307/579309524.jpg\"/></p><p class=\"pictext\" style=\"text-align:center;\">　　顾家台村的圆梦路（人民网记者 翁奇羽 摄）</p><p>　　二</p><p>　　甘肃中部地区自然条件恶劣，缺水干旱，定西、临夏有“瘠苦甲于天下”之称，现在处于连片特困地区，2013年2月2日至5日，习近平总书记来到甘肃定西渭源县田家河乡元古堆村、临夏回族自治州东乡族自治县布楞沟村入户看望老党员和困难群众，调研扶贫开发工作。元古堆村2012年全村的人均纯收入仅有1465.8元，每100个村民中有83个是贫困人口，贫困面达83.4%，临夏回族自治州东乡族自治县布楞沟村年均降水量290毫米、蒸发量却有1490毫米，贫困面高达96%。</p><p>　　<strong>调研期间习近平总书记强调，要多到群众最需要的地方去解决问题，多到发展最困难的地方去打开局面。一块儿努力，把日子越过越红火。</strong></p>', '<p style=\"font-size: 18.018px; white-space: normal;\">　我国结直肠癌的发病率和死亡率保持上升趋势，多数患者发现时艺术与中晚期，常需要多学科联合诊治。由北京协和医院邱辉忠教授牵头，联合两家医院普通外科、消化内科、放射科、病理科、放疗科、肿瘤科专家拟于2016年5月25日在北京召开“结直肠肿瘤多学科综合治疗专家讨论会”。</p><p style=\"font-size: 18.018px; white-space: normal;\"><span style=\"font-family: 微软雅黑, sans-serif; font-size: 17px;\">【会议议程】</span></p><p><img src=\"http://www.z-box.com.cn/ueditor/upload/image/20160520/1463737664989095926.png\" title=\"1463737664989095926.png\" alt=\"5.25议程白.png\" width=\"718\" height=\"893\" style=\"width: 718px; height: 893px;\"/></p>', '2016-07-13 00:00:00', '2016-07-15 00:01:00', '0', '1', null, '[{\"type\":\"bg_tv\",\"url\":\"http://7xo6el.com2.z0.glb.qiniucdn.com/Fq850Yj5q2wwi1yYJJdO_fWKl3-h\"},{\"type\":\"bg_wx\",\"url\":\"http://7xo6el.com2.z0.glb.qiniucdn.com/FvDHi96GDTD4IrL2oS9vvWFx3myl\"},{\"type\":\"banner_tv\",\"url\":\"http://7xo6el.com2.z0.glb.qiniucdn.com/Fjm9Ob5nbJ-a_maw2f7fFhNYAtd7\"},{\"type\":\"banner_wx\",\"url\":\"http://7xo6el.com2.z0.glb.qiniucdn.com/FhiFQ2MV7ngvasHHqTidkhDnETHh\"},{\"type\":\"cover_wx\",\"url\":\"http://7xo6el.com2.z0.glb.qiniucdn.com/Fovfrj10O3ANCla26F9o1Ux8qrrc\"}]', null, null, '2016-07-13 12:00:00', '2016-07-21 12:01:00', '123', '77', '', '1', '1', '直播测试asdasdhttp://live.vhdong.com/Home/LoginAPI?cid=209&url=wtzg?username=motong&mobile=motong®ist=true', '1', null);
INSERT INTO `broadcast` VALUES ('2', 'fcd62c5a-724b-4ba0-859d-2288c4ee0486', '2016-03-09 14:54:20', '2016-05-30 15:54:04', '信视角', 'xinshijiao', '41', null, 'http://live.vhdong.com/ychz', '<p class=\"f_center\" style=\"padding: 0px; margin-top: 26px; margin-bottom: 26px; text-align: center; color: rgb(37, 37, 37); font-family: 宋体, sans-serif; line-height: 28px; white-space: normal; background-color: rgb(255, 255, 255);\"><img alt=\"习近平在湖南代表团参加审议\" id=\"{640EAC98-3272-4FA8-A604-88D1D77418CD}\" src=\"http://img1.cache.netease.com/catchpic/C/CA/CAF485B7097F7F03574311293C869BD1.jpg\" align=\"middle\" border=\"0\" style=\"vertical-align: top; border: 0px; height: 592px; width: 900px;\"/><br/>习近平与湖南团代表共议精准扶贫，关心十八洞村村民婚姻大事。</p><p style=\"padding: 0px; margin-top: 26px; margin-bottom: 26px; text-indent: 2em; color: rgb(37, 37, 37); font-family: 宋体, sans-serif; line-height: 28px; text-align: justify; white-space: normal; background-color: rgb(255, 255, 255);\">新华网北京3月8日电&nbsp; 8日上午，习近平参加湖南代表团审议。湘西土家族苗族自治州州长郭建群代表在发言中，回忆起2013年11月习近平总书记到十八洞村考察的情景，着重介绍了近两年“精准扶贫”进展情况。习近平说，我正式提出“精准扶贫”就是在十八洞村，前几天中央电视台报道的十八洞村脱贫进展情况，我都看了。“现在人均收入有多少了？”总书记问。“您当年来的时候是1680元，现在已经增加到3580元。”郭建群答。郭建群接着说，十八洞村百姓收入增加，村容村貌变化，已成为全省文明村和旅游定点村，村民笑容多了、求发展愿望强了，连大龄男青年解决“脱单”问题也容易了。总书记问：“去年有多少人娶媳妇儿？”“7个。”郭建群答道。代表们发出会心的笑声。当得知全州还有50万贫困人口，习近平问：“条件比十八洞村还差的有多少？”郭建群说，十八洞村的条件算中等的。总书记追问：“不如它的有多少？”“接近一半。”郭建群答。习近平要求当地党委和政府加大工作力度，带领当地群众一起艰苦奋斗，早日实现脱贫目标。</p><p style=\"padding: 0px; margin-top: 26px; margin-bottom: 26px; text-indent: 2em; color: rgb(37, 37, 37); font-family: 宋体, sans-serif; line-height: 28px; text-align: justify; white-space: normal; background-color: rgb(255, 255, 255);\"><strong>习近平：实现藏粮于地、藏粮于技</strong></p><p style=\"padding: 0px; margin-top: 26px; margin-bottom: 26px; text-indent: 2em; color: rgb(37, 37, 37); font-family: 宋体, sans-serif; line-height: 28px; text-align: justify; white-space: normal; background-color: rgb(255, 255, 255);\">湖南是农业大省。8日上午，习近平参加湖南代表团审议，听取了基层代表有关农业问题的意见建议。刘正军代表从环保科技角度谈了已经掌握治理镉超标的核心技术。总书记详细询问这项技术的特点、成本和治理周期。习近平强调，要推进农业供给侧结构性改革，提高农业综合效益和竞争力。要以科技为支撑走内涵式现代农业发展道路，实现藏粮于地、藏粮于技。</p><p style=\"padding: 0px; margin-top: 26px; margin-bottom: 26px; text-indent: 2em; color: rgb(37, 37, 37); font-family: 宋体, sans-serif; line-height: 28px; text-align: justify; white-space: normal; background-color: rgb(255, 255, 255);\"><strong>习近平：要深刻吸取湖南衡阳破坏选举案和四川南充拉票贿选案的教训</strong></p><p style=\"padding: 0px; margin-top: 26px; margin-bottom: 26px; text-indent: 2em; color: rgb(37, 37, 37); font-family: 宋体, sans-serif; line-height: 28px; text-align: justify; white-space: normal; background-color: rgb(255, 255, 255);\">8日上午在湖南团参加审议时，习近平指出，今明两年，全国省市县乡要陆续换届，要深刻吸取湖南衡阳破坏选举案和四川南充拉票贿选案的教训，以“零容忍”的政治态度、规范严谨的法定程序、科学有效的工作机制、严肃认真的纪律要求，坚决杜绝此类现象发生。</p><p style=\"padding: 0px; margin-top: 26px; margin-bottom: 26px; text-indent: 2em; color: rgb(37, 37, 37); font-family: 宋体, sans-serif; line-height: 28px; text-align: justify; white-space: normal; background-color: rgb(255, 255, 255);\"><strong>习近平谈供给侧改革，把握好“加法”和“减法”</strong></p><p style=\"padding: 0px; margin-top: 26px; margin-bottom: 26px; text-indent: 2em; color: rgb(37, 37, 37); font-family: 宋体, sans-serif; line-height: 28px; text-align: justify; white-space: normal; background-color: rgb(255, 255, 255);\">习近平8日上午参加湖南省代表团审议，有代表结合供给侧结构性改革，就加快湖南制造强省建设提出建议。习近平强调，推进供给侧结构性改革是一场硬仗，要把握好“加法”和“减法”，增加要素投入，促进经济总量增加，减少无效和低端供给，扩大有效和中高端供给，提高全要素生产率。</p>', null, '2016-03-10 00:00:00', '2016-03-10 00:00:00', '0', '1', null, '[{\"type\":\"bg_wx\",\"url\":\"http://7xo6el.com2.z0.glb.qiniucdn.com/FvDHi96GDTD4IrL2oS9vvWFx3myl\"},{\"type\":\"banner_tv\",\"url\":\"http://7xo6el.com2.z0.glb.qiniucdn.com/Fjip3HJLRBGjFaDXjstS49MOK5MC\"},{\"type\":\"banner_wx\",\"url\":\"http://7xo6el.com2.z0.glb.qiniucdn.com/Fs79_KDynkDOr5bLnF2gqv19JikQ\"},{\"type\":\"cover_wx\",\"url\":\"http://7xo6el.com2.z0.glb.qiniucdn.com/FlymI18eo5XuRh3BhBdzT0NNAp_s\"}]', null, null, '2016-03-16 10:00:00', '2016-03-16 14:30:00', '', null, null, '1', '1', '8日上午，习近平参加湖南代表团审议。正值三八国际劳动妇女节，总书记代表党中央、国务院，向女代表、女委员、女工作人员和全国各族各界妇女致以节日的祝贺和诚挚的祝福。会议结束时，习近平同代表们握手道别。女代表纷纷围拢过来，向总书记表示感谢。习近平再次向妇女同胞表示祝贺。', '1', null);
