INSERT INTO `news_info` VALUES ('1', '0fc925c9-ab3a-46bf-97f1-75e30d929103', '2015-11-09 18:50:16', '2016-06-28 14:49:01', '17', '精彩推荐', '2', '', '<span style=\"color: rgb(50, 50, 50); font-family: 黑体, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 24px;\">“知了云盒”是由上海翼得营销策划有限公司以及上海郞客信息技术有限公司共同开发，“知了云盒”以网络平台为主，搭建中国医学领域多媒体教育学习互动平台，“知了云盒”涵盖电视盒子，手机，ipad等多媒体数字终端，构建网络一体化的学术交流、沟通平台。</span><br/><p style=\"margin-top: 0px; margin-bottom: 0px; color: rgb(50, 50, 50); font-family: 黑体, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 24px; white-space: normal;\">“知了云盒”内容丰富，涵盖麻醉、内科、外科等各大领域。旨在普及学术知识，促进学术沟通，通过学术知识推送、核心知识的讲授、临床应用技能的培训，全面提升医生临床思维能力和诊断技能。</p>', '1', '知了', '2', '1');
INSERT INTO `news_info` VALUES ('2', 'aef287f4-ba81-4cef-b417-3332daf64c6b', '2015-11-10 13:37:41', '2017-01-18 16:57:43', '16', '敬请期待', ' ', '', '<p><img src=\"http://assets.lankr.cn/kalean/2015/11/10/143/161761020/6d15631f93030fb906c3b2de38033b0f.jpg\" width=\"100%\"/></p><p>&nbsp;</p>', '', '知了云盒', '2', '1');
INSERT INTO `news_info` VALUES ('3', 'd9a99875-541b-44c2-9f6e-253954957f1b', '2015-12-08 18:41:54', '2017-01-18 17:01:40', '50', '习近平提4个歼灭战 楼市去库存位列其中', '中央经济工作会议召开在即，化解房地产库存位列“四个歼灭战”之一，此举不在于继续助推楼市，而有助于摆脱土地财政', 'http://7xo6el.com2.z0.glb.qiniucdn.com/FtsoDmyDi6QkmYEmr5lLJeZoHyYc', '<p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; font-family: &#39;Microsoft YaHei&#39;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;\">统计局的最新数据显示，前10月全国空置住房又创新高，与此同时，房地产投资却创出新低。上述接近高层的研究人士告诉《第一财经日报》，目前中国经济仍然处在下探过程中，能否在一两年内实现触底和转型，房地产可以说是这个过程中最重要的一只靴子。</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; font-family: &#39;Microsoft YaHei&#39;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;\">　　房地产库存到底有多少？根据统计局11月公布的今年1~10月房地产数据，截至10月底，全国商品房待售面积68632万平方米，比9月末增加2122万平方米，其中，住宅待售面积增加1180万平方米，再创历史新高。</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; font-family: &#39;Microsoft YaHei&#39;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;\">　　库存的持续高位对房地产投资数据产生了巨大的负面影响。根据统计局数据，1~10月，全国房地产开发投资78801亿元，同比名义增长2.0%，增速比1~9月份回落0.6个百分点，创历史新低。</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; font-family: &#39;Microsoft YaHei&#39;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;\">　　尽管统计局提供了较为明确的数据，但本报记者采访的多名业内人士和机构分析员均认为，中国的房地产实际库存和分布存在着许多争议。</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; font-family: &#39;Microsoft YaHei&#39;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;\">　　例如，此前有媒体报道称，现有空置房可解决近2亿人的住房问题。但根据统计局数据，按照中国人均住房面积35平方米计算，68632万平方米的“空置”住房仅仅可供2000万人口居住。</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; font-family: &#39;Microsoft YaHei&#39;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;\">　　又比如，西南财经大学中国家庭金融调查与研究中心2014年曾发布一份报告称，2013年中国城镇地区整体住房空置率为22.4%，具体数额为 4898万套。报告分析称，中国城镇地区可以实现刚性住房的需求上升限量大约是2300万套，可以实现改善型的住房需求上升限量大约是950万套，总计 3250万套。但空置住房4898万套和待售商品住宅350万套，总供给达到5248万套。结论是，现有空置住房完全可以安置无房人员。</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; font-family: &#39;Microsoft YaHei&#39;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;\">　　对于这些争议，上述接近高层的研究人士告诉本报记者，中央并没有就具体地方、具体库存数据做出硬性安排，未来的政策布局也是全局性的，更重要的是借助市场的力量引导资源配置和供需流动。</p><p><br/></p>', '', '有礼', '1', '1');
INSERT INTO `news_info` VALUES ('4', '4c697b1f-9b36-42c5-907a-4b2928cfdd17', '2015-12-08 18:43:04', '2017-01-18 17:01:27', '50', '今天红色预警 北京书记市长不打招呼去哪了', '受空气重污染影响，北京于今日7时至10日12时启动红色预警措施。红色预警下，全市机动车实行单双号限行，公车在此基础上再停驶30%。', 'http://7xo6el.com2.z0.glb.qiniucdn.com/FgTuUl32GKU1s5350NlCI3ITJQy2', '<p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; font-family: &#39;Microsoft YaHei&#39;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;\">今日是红色预警第一天，预警就是命令。市委书记郭金龙、市长王安顺一大早就分头带队检查空气重污染应对措施落实情况。他们都去哪了？长安街知事（微信ID：Capitalnews）跟着他们一同去了现场——</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; font-family: &#39;Microsoft YaHei&#39;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;\">　　郭金龙来到市环保局，一进门就直奔主题说：“在气象、环保等部门科学研判的基础上，本市第一次启动了空气重污染红色预警。这一决策，得到了全市广大人民 群众的理解和支持。这次来，就是要了解气象、环保部门对下一阶段雾霾过程趋势的研判；了解红色预警启动后，各项应对措施对雾霾过程将会产生什么样的影 响”。</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; font-family: &#39;Microsoft YaHei&#39;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;\">　　郭金龙还通过全国城市空气质量实时发布平台，察看了京津冀及周边地区空气质量。他指出，在首都北京首次启动空气重污染红色预警， 各方高度关注。要以科学的态度做好研判，坚持依法行政，实施好各项应对措施，更好履行政府职责，更广泛唤醒积极参与大气污染防治的公众意识，把全社会动员 起来、凝聚起来，攻坚克难，共同打好大气污染防治攻坚战，切实把绿色发展理念落到实处，推动首都可持续发展。</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; font-family: &#39;Microsoft YaHei&#39;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;\">　　郭金龙叮嘱，要在实施应急预案过程中，注重积累做好大气污染防治工作的经验，积累如何降低重污染天气对生产生活影响的经验， 维护人民群众身体健康，取得较好的社会效果。同时要积极回应社会关切，做好社会舆论引导，方方面面齐动员，打好大气污染防治攻坚战。</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; font-family: &#39;Microsoft YaHei&#39;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;\">　　王安顺带的一队不发通知、不打招呼、不听汇报、不用陪同接待、直奔基层、直插现场，检查各项应对措施落实情况。短短一上午时间，长安街知事（微信ID：Capitalnews）跟着市长一连检查了5个点，这个工作节奏，必须点赞。</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; font-family: &#39;Microsoft YaHei&#39;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;\">　　在长安街西单路口，王安顺与执勤交警握手表达敬意。他说，无论风雨还是雾霾，交警总是在辛勤坚守岗位。我们的各项措施，最终要靠严格执法来落实。</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; font-family: &#39;Microsoft YaHei&#39;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;\">　　正说话间，一辆单号机动车自北向西右转，王安顺和交警一起拦下车。市长询问司机从哪来？是否接到了单双号限行的消息？司机小杨说是从天通苑来上班，确实 还不知道限行消息。经市长提醒，小杨拿出手机一看，才发现短信和微信朋友圈已经满是消息。市长建议小杨今后再遇到这种情况乘地铁出行，小杨连连点头表示今 后一定遵守限行。</p><p><br/></p>', '', '有礼', '1', '1');
INSERT INTO `news_info` VALUES ('5', 'ead6dcde-01db-4669-8a99-d3e6e77d6a41', '2015-12-10 17:41:48', '2017-01-18 16:57:40', '17', '习近平将亲赴互联网大会 致辞规格有所提升', '国务院新闻办公室2015年12月9日（星期三）上午10时举行新闻发布会，请国家互联网信息办公室和浙江省负责同志介绍第二届世界互联网大会有关情况及筹备工作进展，并答记者问。图为国家互联网信息办公室主任鲁炜回答记者问题。记者 杨同贺 摄', '2d4cd3aa34d74760ed165cd9bb509303', '<p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; font-family: &#39;Microsoft YaHei&#39;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;\">经可以看出这次发布的信息，非同一般。</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; font-family: &#39;Microsoft YaHei&#39;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;\">　　果然，一条重磅信息迅速从会场传遍互联网——12月16日至18日的第二届世界互联网大会，习近平总书记要亲自出席，并在开幕式上致辞。相比去年第一届大会，习总致贺词的规格，此次显然又有提升。</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; font-family: &#39;Microsoft YaHei&#39;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;\">　　时近年底，大家都感到很忙，各种过去要盘点要总结，各种未来要谋划要迎接。所以，大家也肯定知道，习总的年底会更忙。刚刚结束一轮旋风外交，国内还有许多重要会议、各种重要公务活动。能让他亲自出京出席这个会议，可见习总对这件事情有多重视。</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; font-family: &#39;Microsoft YaHei&#39;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;\">　　我们知道，习总本人对互联网非常重视，在国际国内不同的场合，他都对这个问题有过重要论述。仔细梳理分析，学习小组（微信号：xuexixiaozu）发现，习总对互联网问题的论述，有一条严谨的逻辑链条：</p><p><br/></p>', '', '精彩推荐', '2', '1');
INSERT INTO `news_info` VALUES ('6', 'b6ce7d19-eadb-4114-9e9a-84da70190f09', '2015-12-10 17:43:08', '2017-01-18 16:57:39', '18', '北京将实行积分落户制度 今起公开征求意见', '今天下午,北京市政府法制办将就积分落户管理办法和居住证管理办法两个征求意见稿,在网上公开向社会征求意见', '9efababc052aff2965ad9a1ba9277103', '<p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; font-family: &#39;Microsoft YaHei&#39;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;\">　未来5年,北京将如何发展?公布的“关于制定北京市国民经济和社会发展第十三个五年规划的建议”,对这一问题进行了解答。</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; font-family: &#39;Microsoft YaHei&#39;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;\">　　PM2.5浓度何时、怎样下降?2300万人口“天花板”目标如何达成?北京行政副中心建成什么样?长期在京工作生活是否有望通过居住证落户?北京怎样才能告别拥堵的城市公路?</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; font-family: &#39;Microsoft YaHei&#39;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;\">　　作别“摊大饼”时代的北京,在“腾笼换鸟”、“瘦身健体”等决心中,借非首都功能疏解和京津冀协同发展,综合用力摆脱“大城市病”。</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; font-family: &#39;Microsoft YaHei&#39;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;\">　　在剥离“白菜帮”、只留“白菜心”的目标中,记者综合梳理规划建议,以人口、环保、户籍、交通、城管、生态、城区功能、教育为关键词,逐一解读北京未来5年的发展路径。</p><p><br/></p>', '', '分享有礼', '2', '1');
INSERT INTO `news_info` VALUES ('7', 'e6bb5bed-aec7-4e76-a371-3fe7b4b18036', '2016-01-18 16:55:18', '2017-01-18 16:57:37', '18', '科比9助攻湖人吞3连败 哈登31分火箭攻克洛城', '火箭（22-20）轻松过关，本赛季三度大胜湖人。詹姆斯-哈登打了27分钟，拿下31分5次助攻，德怀特-霍华德14分15个篮板，克林特-卡佩拉14分11个篮板，特雷沃-阿里扎13分。全队7人得分上双，替补出场的泰-劳森12分。', 'd0cbfe62fb09f65317f35d5d0574c1fc', '<p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; font-size: 14px; line-height: 23px; color: rgb(51, 51, 51); font-family: 宋体; white-space: normal; background-color: rgb(255, 255, 255);\">18日，湖人主场以95-112不敌火箭。</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; font-size: 14px; line-height: 23px; color: rgb(51, 51, 51); font-family: 宋体; white-space: normal; background-color: rgb(255, 255, 255);\">　　火箭（22-20）轻松过关，本赛季三度大胜湖人。詹姆斯-哈登打了27分钟，拿下31分5次助攻，德怀特-霍华德14分15个篮板，克林特-卡佩拉14分11个篮板，特雷沃-阿里扎13分。全队7人得分上双，替补出场的泰-劳森12分。</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; font-size: 14px; line-height: 23px; color: rgb(51, 51, 51); font-family: 宋体; white-space: normal; background-color: rgb(255, 255, 255);\">　　湖人（9-34）三连败。科比-布莱恩特只打了两节，贡献9次助攻，得了5分。路易斯-威廉姆斯20分，乔丹-克拉克森16分，朱利叶斯-兰德尔12分11个篮板。替补出场德安杰罗-拉塞尔12分5次助攻。</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; font-size: 14px; line-height: 23px; color: rgb(51, 51, 51); font-family: 宋体; white-space: normal; background-color: rgb(255, 255, 255);\">　　两队都是背靠背作战。火箭似乎可以给主力一些休息时间，因为此前两次交手，火箭都大胜湖人。[<a href=\"http://ai.lottery.sina.com.cn/nba/\" target=\"_blank\" style=\"color: rgb(4, 84, 167); text-decoration: none;\">赛果提前知！NBA智能预测算准火箭赢球</a>]</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; font-size: 14px; line-height: 23px; color: rgb(51, 51, 51); font-family: 宋体; white-space: normal; background-color: rgb(255, 255, 255);\">　　在两次大胜是，哈登共得了55分，霍华德得了34分27个篮板。科比也有不俗表现，两场大战共得47分。</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; font-size: 14px; line-height: 23px; color: rgb(51, 51, 51); font-family: 宋体; white-space: normal; background-color: rgb(255, 255, 255);\">　　今天的形势仍然差不多，不过在上半场，湖人有很强的竞争力。</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; font-size: 14px; line-height: 23px; color: rgb(51, 51, 51); font-family: 宋体; white-space: normal; background-color: rgb(255, 255, 255);\">　　科比有伤在身。他自己都说要打入篮下很困难，甚至连投篮时都受到影响。科比改变了作战方式，开始不断给队友传球。</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; font-size: 14px; line-height: 23px; color: rgb(51, 51, 51); font-family: 宋体; white-space: normal; background-color: rgb(255, 255, 255);\">　　湖人第一次得分就来自科比的助攻。火箭以16-11领先之后，科比又一次妙传，克拉克森中投命中，他连续三次助攻，本节还有5分18秒时，自己投篮命中，湖人以21-18反超。科比此后继续帮助队友得分，自己有机会时也不会手软。本节还有56.3秒时，科比三分命中，湖人以34-28领先。首节过后，他们以36-32略占优势。</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; font-size: 14px; line-height: 23px; color: rgb(51, 51, 51); font-family: 宋体; white-space: normal; background-color: rgb(255, 255, 255);\">　　首节科比就有7次助攻进账，个人生涯总助攻达到6342次，超过了杰里-韦斯特，居湖人队史第二。</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; font-size: 14px; line-height: 23px; color: rgb(51, 51, 51); font-family: 宋体; white-space: normal; background-color: rgb(255, 255, 255);\">　　第二节科比休息，湖人大部分时间仍能与火箭抗衡。本节还有9分17秒时，巴斯两罚两中，湖人仍以41-39领先。哈雷尔扣篮还以颜色，火箭发动攻击波，哈登和霍华德也接连得分，火箭在本节过半时以49-43领先。湖人几度将差距缩小到2分，上半场只以57-60落后。</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; font-size: 14px; line-height: 23px; color: rgb(51, 51, 51); font-family: 宋体; white-space: normal; background-color: rgb(255, 255, 255);\">　　火箭以一波9-0开始第三节，一举以69-57拉开差距。本节打了近3分钟后，科比在三分线内跳起，佯装投篮，不过突然手腕一压，将球传到篮下，克拉克森轻松上篮。湖人连得4分，但激起火箭更强的反击，哈登连续命中三分，火箭一举以77-61领先了16分。双方差距越拉越大，本节还有4分02秒时，阿里扎连投带罚拿下3分，他们以86-64领先。科比又一次助攻，湖人打出7-0，但只能略为缩小差距。三节过后，火箭以94-75领先。</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; font-size: 14px; line-height: 23px; color: rgb(51, 51, 51); font-family: 宋体; white-space: normal; background-color: rgb(255, 255, 255);\">　　最后一节科比又成为看客。火箭将优势扩大到21分后，布朗两度投篮命中，湖人打出6-0，在比赛还有8分35秒时将比分追成83-98。哈雷尔和索顿相继还以颜色，劳森此后命中三分，火箭又将优势扩大到20分，胜负失去悬念。（吴哥）</p><p><br/></p>', '分享', 'zhiliao', '2', '1');
INSERT INTO `news_info` VALUES ('8', 'a7fa7434-95d0-4010-b71b-b9168ca35d9e', '2016-01-18 16:57:20', '2017-01-18 16:57:35', '18', '习近平将访问中东 中国伊朗将签高铁和能源协议', '1月15日，中国外交部发言人陆慷宣布：应沙特阿拉伯王国国王萨勒曼、阿拉伯埃及共和国总统塞西、伊朗伊斯兰共和国总统鲁哈尼邀请，国家主席习近平将于1月19日至23日对上述三国进行国事访问。', 'c8b2a19bc1f2b34a8ec3cad7290598be', '<p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; font-family: &#39;Microsoft YaHei&#39;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;\">1月15日晚，伊朗驻华大使阿里·阿斯加尔·哈吉在使馆吹风会上表示，伊核协议近两天将在维也纳开始执行，国际社会对伊朗的制裁将被解除。在这样的友好气氛下，习近平主席将在22日至23日对伊朗进行国事访问。两国将宣布建立战略伙伴关系，以提升双边关系定位。</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; font-family: &#39;Microsoft YaHei&#39;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;\">　　哈吉还表示，&nbsp;“在此次访问中，双方将签署和宣布有关‘一带一路’合作备忘录，以更加务实地推动项目进展，促进中国和伊朗、伊朗和邻国之间的关系。”</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; font-family: &#39;Microsoft YaHei&#39;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;\">　　哈吉表示，感谢中方为推动达成伊核全面协议所做的积极努力，中方在关键时期提出的多项建议有效推动了谈判的进展，希望伊核协议生效后，中国能够继续发挥建设性作用。他强调，不会忘记中国在伊朗最艰难的时候提供的帮助。</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; font-family: &#39;Microsoft YaHei&#39;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;\">　　自2013年以来，中伊两国元首已经进行了6次会晤。2014年5月，伊朗总统鲁哈尼对中国进行国事访问，并出席在上海举行的亚洲相互协作与信任措施会议第四次峰会。</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; font-family: &#39;Microsoft YaHei&#39;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;\">　　对于中国的“一带一路”倡议，哈吉表示，伊朗表示大力支持，相信它会给相关地区带来更多的稳定、繁荣和安全。“伊朗位于世界的‘十字路口’，可以把新丝绸之路的陆路和海路连接在一起，并在中间开辟一个南北通道。”</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; font-family: &#39;Microsoft YaHei&#39;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;\">　　为了支持在“一带一路”框架下的项目对接，哈吉说，伊朗政府专门组建了一个跨部门委员会进行研究，成员包括各个部委、公司、商会的代表。据哈吉介绍，习近平 访问伊朗期间，两国还将签署“相当数量”的双边合作协议。他向21世纪经济报道记者透露，两国在金融、高铁、自由贸易区、能源四个方面都有签约计划。</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; font-family: &#39;Microsoft YaHei&#39;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;\">　　在金融合作方面，中国和伊朗有望达成本币互换协议。两国已经就启动这一机制进行了多次对话。“商谈还在进行中，没有原则性分歧。如果可以完成相关程序，这次就可能签约。如果来不及的话，也会在日后签约。”</p><p style=\"margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; font-family: &#39;Microsoft YaHei&#39;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;\">　　伊朗正在加速推动经济“去美元化”，人民币有望成为伊朗的“宠儿”。“今年年初，人民币加入国际货币基金组织特别货币提款权货币篮子，这是世界对中国经济的认可。”哈吉表示，这是一件值得恭喜的事情。</p><p><br/></p>', '', '发', '2', '1');
INSERT INTO `news_info` VALUES ('9', '7619dd2f-5003-46f3-b6e2-9f75be357fd3', '2016-02-04 01:21:43', '2017-01-18 16:58:32', '30', '习近平：按照五个要求建设政法队伍', '再科学的法规也必须有高素质的人来执行，才能成为真正的良法。只有拥有一支优秀的政法队伍，才能实现全面依法治国。怎样培养出素质高、本领硬的 政法队伍？习近平指出：“要按照政治过硬、业务过硬、责任过硬、纪律过硬、作风过硬的要求，努力建设一支信念坚定、执法为民、敢于担当、清正廉洁的政法队 伍。”', '5168dcc6c660ee25ed173b4e2971539a', '<script type=\"text/javascript\">var write_sceen_time = (+new Date());</script><p><iframe class=\"video_iframe\" height=\"502.5\" width=\"670\" frameborder=\"0\" data-src=\"https://v.qq.com/iframe/preview.html?vid=f0174k242yn&amp;width=500&amp;height=375&amp;auto=0\" allowfullscreen=\"\" style=\"z-index: 1; width: 670px !important; height: 502.5px !important; overflow: hidden;\" src=\"https://v.qq.com/iframe/player.html?vid=f0174k242yn&width=670&height=502.5&auto=0\" scrolling=\"no\"></iframe><br/></p><p>知了云盒(Z-BOX)产品发布会于11月28日在上海国际会议中心召开，近百名知名药企高管及医疗领域学术专家出席了本次发布会。</p><p><br/></p><p><span style=\"font-size: 20px; color: rgb(0, 128, 255);\"><strong>知了云盒(Z-BOX)——开启医学新纪元</strong></span></p><p>知了云盒(Z-BOX)打造了一种全新的CME (Continuing Medical Education)形式，为医疗相关从业人员提供全领域一站式服务。实现了跨平台终端支持，使用无时间地域等限制。让CME更方便，更有效，医生能够更充分利用碎片时间进行学习。</p><p><span style=\"line-height: 1.6;\">知了云盒(Z-BOX)会成为医疗相关行业从业人员的线上学术交流互动平台。满足各层级医务工作者学术需求。</span></p><p style=\"text-align: center;\"><img data-s=\"300,640\" data-type=\"png\" data-src=\"http://mmbiz.qpic.cn/mmbiz/4lLibckk2xJdkZejEJovDDEmaGBczEPMSHpGgmslLLOIvaCOSzNMXCqZp2KkNtUdXprxg29t2IPKwVudpJobLpw/0?wx_fmt=png\" data-ratio=\"0.4856115107913669\" data-w=\"\" src=\"http://mmbiz.qpic.cn/mmbiz/4lLibckk2xJdkZejEJovDDEmaGBczEPMSHpGgmslLLOIvaCOSzNMXCqZp2KkNtUdXprxg29t2IPKwVudpJobLpw/640?wx_fmt=png&wxfrom=5&wx_lazy=1\" style=\"width: auto !important; visibility: visible !important; height: auto !important;\"/><br/></p><p style=\"margin-top: 10px;\">在不久的将来，知了云盒(Z-BOX)将延伸到各个常用移动终端，并广泛运用到各个场景，医生家中客厅电视、知了手机端、知了网站、科室电教系统等等。</p><p><br/></p><p style=\"margin-bottom: 10px;\">来自知名药企的代表及医院专家参与了创新医疗传播的话题，他们表示知了云盒将会成为重要的医疗继续教育平台，并且跨越时间与地域的限制为医生提供很好的学习交流平台。知了云盒(Z-BOX)的用户通过手机及电视进行医疗继续教育，这将会充分利用医务工作者碎片时间，大大提升学习效率。</p><p><img data-s=\"300,640\" data-type=\"jpeg\" data-src=\"http://mmbiz.qpic.cn/mmbiz/4lLibckk2xJdkZejEJovDDEmaGBczEPMSGwzxlAYsFudwvMEmRGWjvqiaxZf7ySWrWwpqxmmPuca7Gibficic2vQia7Q/0?wx_fmt=jpeg\" data-ratio=\"0.75\" data-w=\"\" src=\"http://mmbiz.qpic.cn/mmbiz/4lLibckk2xJdkZejEJovDDEmaGBczEPMSGwzxlAYsFudwvMEmRGWjvqiaxZf7ySWrWwpqxmmPuca7Gibficic2vQia7Q/640?wx_fmt=jpeg&wxfrom=5&wx_lazy=1\" style=\"width: auto !important; visibility: visible !important; height: auto !important;\"/><br/></p><p><img data-s=\"300,640\" data-type=\"jpeg\" data-src=\"http://mmbiz.qpic.cn/mmbiz/4lLibckk2xJfn0apQHU5lS1kxMsNZ1C4CMLuguyF5t6S4OibAeaENBhAsnfbI20ZVeQdm0qgfYictibRKIxXxdSSdg/0?wx_fmt=jpeg\" data-ratio=\"0.6636690647482014\" data-w=\"\" src=\"http://mmbiz.qpic.cn/mmbiz/4lLibckk2xJfn0apQHU5lS1kxMsNZ1C4CMLuguyF5t6S4OibAeaENBhAsnfbI20ZVeQdm0qgfYictibRKIxXxdSSdg/640?wx_fmt=jpeg&wxfrom=5&wx_lazy=1\" style=\"width: auto !important; visibility: visible !important; height: auto !important;\"/><br/></p><p><br/></p><section style=\"box-sizing: border-box; background-color: rgb(255, 255, 255);\"><section class=\"Powered-by-XIUMI V5\" style=\"   box-sizing: border-box; \"><section class=\"\" style=\" margin-top: 0.5em; margin-bottom: 0.5em;  box-sizing: border-box; \"><section class=\"\" style=\"border-top-width: 2px; border-top-style: solid; border-color: rgb(95, 156, 239); box-sizing: border-box;\"><section class=\"\" style=\"display: inline-block; padding-right: 0.5em; padding-left: 0.5em; color: rgb(255, 255, 255); box-sizing: border-box; background-color: rgb(95, 156, 239);\"><section style=\"box-sizing: border-box;\">小云来送礼</section></section></section></section></section><section class=\"Powered-by-XIUMI V5\" style=\"box-sizing: border-box;\"><section class=\"\" style=\"   box-sizing: border-box; \"><section class=\"\" style=\"box-sizing: border-box;\"><section style=\"box-sizing: border-box;\">是不是还惦记着上周答应你们的活动呢？这就揭晓中奖