INSERT INTO `news_info` VALUES ('10', 'cae8fb61-eff3-404a-b83b-34f4c1180f54', '2016-02-04 01:22:32', '2017-01-18 16:58:31', '30', '习近平：画出最大同心圆', '十三五”是全面建成小康社会的决胜阶段，今年是开局之年，开好局、起好步，是取得全面胜利的关键一步。如何开好局并取得最后胜利？2016年1月29日，习近平同党外人士共迎新春时指出：“人心向背、力量对比决定事业成败。我们提出坚持正确处理一致性和多样性关系的方针，就是着眼于形成最大公约数，画出最大的同心圆。”', 'http://cloud.lankr.cn/api/image/c378915b7caa6f5d5227cd7333767da3?m/2/h/500/f/jpg', '<p>&lt;%@ page=&quot;&quot; language=&quot;java&quot; contenttype=&quot;text/html; charset=UTF-8&quot; pageencoding=&quot;UTF-8&quot;&gt;</p><meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\"/><meta content=\"template language\" name=\"keywords\"/><meta content=\"author\" name=\"author\"/><meta content=\"width=device-width, initial-scale=1, maximum-scale=1, minimum-scale=1, user-scalable=no\" name=\"viewport\"/><meta content=\"yes\" name=\"mobile-web-app-capable\"/><meta content=\"yes\" name=\"apple-mobile-web-app-capable\"/><meta content=\"telephone=no\" name=\"format-detection\"/><meta content=\"email=no\" name=\"format-detection\"/><meta content=\"black-translucent\" name=\"apple-mobile-web-app-status-bar-style\"/><link href=\"/assets/css/app/font.css\" rel=\"stylesheet\"/><link href=\"/assets/css/app/default.css\" rel=\"stylesheet\"/><link href=\"/assets/css/app/disposable.css\" rel=\"stylesheet\"/><title>摇一摇 神奇的知了云盒带回家</title><div class=\"page shakeAward\"><div class=\"content index\" id=\"envelopes_index\"><div class=\"logo\"><a href=\"/api/webchat/index\"><img src=\"/assets/img/app/shakeAward/logo.png\" width=\"100%\"/></a></div><div class=\"title active\"><img src=\"/assets/img/app/shakeAward/title.png\" width=\"86%\"/></div><div class=\"tag\"><img src=\"/assets/img/app/shakeAward/tag.png\" width=\"96%\"/></div><div class=\"gift_box\"><img src=\"/assets/img/app/shakeAward/gift_box.png\" width=\"60%\"/></div></div><div class=\"content result hide\" id=\"envelopes_result\"><div class=\"logo\"><a href=\"/api/webchat/index\"><img src=\"/assets/img/app/shakeAward/logo.png\" width=\"100%\"/></a></div><div class=\"tips\"><img src=\"/assets/img/app/shakeAward/tt_tag.png\" width=\"91%\"/><p class=\"tt\" id=\"envelopes_tips\"><br/></p></div><div class=\"gift_box hide\" id=\"winning\"><img src=\"/assets/img/app/shakeAward/winning.png\" width=\"100%\"/><img src=\"/assets/img/app/shakeAward/winning_img.png\" width=\"100%\" class=\"img\"/></div><div class=\"gift_box\" id=\"winning_no\"><img src=\"/assets/img/app/shakeAward/winning_no.png\" width=\"100%\"/><img src=\"/assets/img/app/shakeAward/winning_img_no.png\" width=\"100%\" class=\"img\"/></div><div class=\"float_intro\" id=\"envelopes_intro\"><h5 class=\"tt\">您知道吗？</h5><div id=\"float_intro_div\" class=\"info\"></div></div></div><div class=\"btn_group clearfix\"><div class=\"btn\" id=\"btn_rule\">活动规则</div><div class=\"btn\" id=\"btn_record\">抽奖记录</div></div><div class=\"float_info\" id=\"info_rule\"><h5 class=\"tt\">活动规则</h5><div class=\"info\"><p>活动时间：</p><p>4.21 00:00-4.23 23:59</p><p>参与方式：</p><p>摇一摇，就有机会获把知了云盒带回家！</p><p>每人共有三次机会。</p></div><div class=\"close\">╳</div></div><div class=\"float_info\" id=\"info_record\"><h5 class=\"tt\">抽奖纪录</h5><ul id=\"record_list_ul\" class=\"record_list list-paddingleft-2\"></ul><div class=\"close\">╳</div></div></div><audio id=\"bg_music\" preload=\"metadata\" controls=\"\" autoplay=\"false\"></audio><script type=\"text/javascript\" src=\"/assets/js/jquery.js\"></script><script type=\"text/javascript\" src=\"http://res.wx.qq.com/open/js/jweixin-1.0.0.js\"></script><script type=\"text/javascript\" src=\"/assets/js/wechat/shake.js\"></script><script type=\"text/javascript\">$(document).ready(function(){\r\n        var myShakeEvent = new Shake({\r\n          threshold: 10, // optional shake strength threshold\r\n          timeout: 1000 // optional, determines the frequency of event generation\r\n        });\r\n\r\n        var bgMedia = $(\'#bg_music\');\r\n        var bgMusic = bgMedia.attr(\'src\');\r\n        var firstTime = true;\r\n\r\n        myShakeEvent.start();\r\n\r\n        window.addEventListener(\'shake\', shakeEventDidOccur, false);\r\n\r\n        function shakeEventDidOccur(){\r\n          if (!firstTime){\r\n            $(\'#envelopes_index\').fadeIn();\r\n            $(\'#envelopes_result\').fadeOut();\r\n          }\r\n\r\n        	//摇完之后出现的效果\r\n          if(!bgMusic){\r\n            bgMedia.attr(\'src\', \'/assets/wechat.mp3\');\r\n          }\r\n\r\n          setTimeout(function(){\r\n        	  bgMedia.play();\r\n          }, 1000);\r\n\r\n          //请求数据\r\n          $.getJSON(\'/api/webchat/game/yao/action?timestamp=\'+new Date().getTime(),function(data){\r\n        	  console.log(data);\r\n          	var envelopes_tips=$(\'#envelopes_tips\');\r\n          	var envelopes_intro=$(\'#envelopes_intro\');\r\n          	var code=data.code;\r\n          	var winning=$(\'#winning\');\r\n      		  var winning_no=$(\'#winning_no\');\r\n          	if(code==0){\r\n          		var money=data.money;\r\n          		money=10;\r\n          		var result;\r\n          		if(money>0){\r\n          			 result=\'恭喜您，获得知了云盒一台，还有\'+data.times+\'次机会！\';\r\n          			 winning.show();\r\n          			 winning_no.hide();\r\n          		}else{\r\n          			 result=\'很遗憾，未抽中，还有\'+data.times+\'次机会！\';\r\n          			 winning.hide();\r\n         			 winning_no.show();\r\n          		}\r\n          		envelopes_tips.html(result);\r\n            	}else if(code==1){\r\n            		envelopes_tips.html(\'您已经没有抽奖机会了\');\r\n            		 winning.hide();\r\n         			 winning_no.show();\r\n            	}else if(code==2){\r\n            		envelopes_tips.html(\'活动还未开始\');\r\n            		 winning.hide();\r\n         			 winning_no.show();\r\n            	}else if(code==3){\r\n            		envelopes_tips.html(\'活动已经结束\');\r\n            		 winning.hide();\r\n         			 winning_no.show();\r\n            	}\r\n          	\r\n          	//随机显示内容\r\n          	var float_intro_div=$(\'#float_intro_div\');\r\n          	var content=[\'知了盒子带回家，让它成为您的客厅教授\',\'知了云盒已经有100多个外科视频啦\',\'2016播客秀已经整合升级到知了云盒啦！\',\'知了云盒是一个可以随时随地进行收看的医学可视化学习分享平台\',\'您可以通过手机微信公众号或通过知了盒子在电视上收看知了云盒学术内容哦！\'];\r\n          	var randomNum = Math.round(Math.random() * 5)%5\r\n          	float_intro_div.html(content[randomNum]);\r\n          	envelopes_intro.show();\r\n\r\n              $(\'#envelopes_index\').find(\'.title\').removeClass(\'active\');\r\n              $(\'#envelopes_index\').find(\'.gift_box\').addClass(\'active\');\r\n\r\n              setTimeout(function(){\r\n                $(\'#envelopes_index\').fadeOut();\r\n                $(\'#envelopes_result\').fadeIn();\r\n              }, 1000);\r\n\r\n              firstTime = false;\r\n          });\r\n\r\n        }\r\n\r\n        $(\'#btn_rule\').click(function(){\r\n           $(\'.float_info\').fadeOut();\r\n          $(\'#info_rule\').fadeIn();\r\n        });\r\n\r\n        $(\'#btn_record\').click(function(){\r\n          var record_list_ul = $(\'#record_list_ul\');\r\n          $.getJSON(\r\n            \'/api/webchat/game/yao/record?timestamp=\'+new Date().getTime(),\r\n            function(data){\r\n              if(data.status==\'success\'){\r\n                record_list_ul.empty();\r\n                var record_list=data.list;\r\n                $.each(record_list,function(index,item){\r\n                  var money=item.money;\r\n                  if(money>0){\r\n                	  money=\'抽中“云盒”\';\r\n                  }else{\r\n                	  money=\"未中奖\";\r\n                  }\r\n                  var date=timeStamp2String(item.date);\r\n                  var li=\'<li><span class=\"date\">\'+date+\'</span>\'+money+\'</li>\';\r\n                  record_list_ul.append(li);\r\n                });\r\n              }\r\n              $(\'.float_info\').fadeOut();\r\n              $(\'#info_record\').fadeIn();\r\n            }\r\n          );\r\n        });\r\n\r\n        $(\'.float_info\').find(\'.close\').click(function(){\r\n          $(this).parents(\'.float_info\').fadeOut();\r\n        });\r\n      });\r\n\r\n      function timeStamp2String (time){\r\n        var datetime = new Date();\r\n        datetime.setTime(time);\r\n        var year = datetime.getFullYear();\r\n        var month = datetime.getMonth() + 1;\r\n        var date = datetime.getDate();\r\n        var hour = datetime.getHours();\r\n        var minute = datetime.getMinutes();\r\n        var second = datetime.getSeconds();\r\n        return repairZero(year) + \"-\" + repairZero(month) + \"-\" + repairZero(date)+\" \"+repairZero(hour)+\":\"+repairZero(minute)+\":\"+repairZero(second);\r\n      }\r\n\r\n      function repairZero(num){\r\n    		if(num<10){\r\n    			return num=\"0\"+num;\r\n    		}\r\n    		return num;\r\n    	}\r\n    </script><script type=\"text/javascript\">$(function() {\r\n        var base_url=location.href.split(\'#\')[0];\r\n        $.getJSON(\'/api/webchat/wx/share/config\', {\r\n          url : base_url,\r\n          timestamp : new Date().getTime()\r\n        }, function(data_sin) {\r\n          if (data_sin.status == \'success\') {\r\n            var title=\'摇一摇\';\r\n            var desc=\"摇一摇，有机会获得知了云盒\";\r\n            var cover=\'http://www.z-box.com.cn/assets/img/webchat/game/yao_share.jpg\';\r\n            initWx(data_sin,title,desc,data_sin.url,cover);\r\n          }\r\n        });\r\n      });\r\n\r\n    //微信的分享的公共方法\r\n      function initWx(data,title,desc,link,imgUrl) {\r\n        wx.config({\r\n          debug : false, // 开启调试模式,调用的所有api的返回值会在客户端alert出来，若要查看传入的参数，可以在pc端打开，参数信息会通过log打出，仅在pc端时才会打印。\r\n          appId : data.appId,\r\n          timestamp : data.timestamp,\r\n          nonceStr : data.nonceStr,\r\n          signature : data.signature,\r\n          jsApiList : [ \'onMenuShareTimeline\', \'onMenuShareAppMessage\',\r\n              \'onMenuShareQQ\', \'onMenuShareWeibo\', \'onMenuShareQZone\',\'chooseImage\', \'previewImage\', \'uploadImage\', \'downloadImage\' ]\r\n        });\r\n\r\n        wx.ready(function() {\r\n          // 分享到朋友圈\r\n          wx.onMenuShareTimeline({\r\n            title : title, // 分享标题\r\n            link : link, // 分享链接\r\n            imgUrl : imgUrl, // 分享图标\r\n            desc : desc,\r\n            success : function() {\r\n              // 用户确认分享后执行的回调函数\r\n              shareRes();\r\n            },\r\n            cancel : function() {\r\n              // 用户取消分享后执行的回调函数\r\n            }\r\n          });\r\n\r\n          // 分享给朋友\r\n          wx.onMenuShareAppMessage({\r\n            title : title, // 分享标题\r\n            desc : desc, // 分享描述\r\n            link : link, // 分享链接\r\n            imgUrl : imgUrl, // 分享图标\r\n            type : \'link\', // 分享类型,music、video或link，不填默认为link\r\n            dataUrl : \'\', // 如果type是music或video，则要提供数据链接，默认为空\r\n            success : function() {\r\n              // 用户确认分享后执行的回调函数\r\n              shareRes();\r\n            },\r\n            cancel : function() {\r\n              // 用户取消分享后执行的回调函数\r\n            }\r\n          });\r\n\r\n          wx.onMenuShareWeibo({\r\n            title : title, // 分享标题\r\n            desc : desc, // 分享描述\r\n            link : link, // 分享链接\r\n            imgUrl : imgUrl, // 分享图标\r\n            success : function() {\r\n              // 用户确认分享后执行的回调函数\r\n              shareRes();\r\n            },\r\n            cancel : function() {\r\n              // 用户取消分享后执行的回调函数\r\n            }\r\n          });\r\n\r\n          wx.onMenuShareQZone({\r\n            title : title, // 分享标题\r\n            desc : desc, // 分享描述\r\n            link : link, // 分享链接\r\n            imgUrl : imgUrl, // 分享图标\r\n            success : function() {\r\n              // 用户确认分享后执行的回调函数\r\n              shareRes();\r\n            },\r\n            cancel : function() {\r\n              // 用户取消分享后执行的回调函数\r\n            }\r\n          });\r\n\r\n          wx.onMenuShareQQ({\r\n            title : title, // 分享标题\r\n            desc : desc, // 分享描述\r\n            link : link, // 分享链接\r\n            imgUrl : imgUrl, // 分享图标\r\n            success : function() {\r\n              // 用户确认分享后执行的回调函数\r\n              shareRes();\r\n            },\r\n            cancel : function() {\r\n              // 用户取消分享后执行的回调函数\r\n            }\r\n          });\r\n\r\n        });\r\n\r\n        wx.error(function(res) {\r\n        });\r\n      }\r\n\r\n      //记录后台分享的资源\r\n      function shareRes(){\r\n        var base_url=location.href.split(\'#\')[0];\r\n        $.post(\'/api/webchat/common/share/page\',\r\n            {\'url\':base_url},\r\n            function(data){\r\n              console.log(data);\r\n            });\r\n      }</script><!--!doctype--><!--%@-->', '', '知了', '2', '1');
