INSERT INTO `resource` VALUES ('113', '2016-01-18 16:55:18', '2017-01-18 16:57:37', 'ad107d9c-c830-4997-8fa0-d1aefb8a1bac', '科比9助攻湖人吞3连败 哈登31分火箭攻克洛城', 'kebi9zhugonghurentun3lianbai hadeng31fenhuojiangongkeluocheng', null, null, '0', 'd0cbfe62fb09f65317f35d5d0574c1fc', null, null, null, '7', null, '18', null, '2', '1', '火箭（22-20）轻松过关，本赛季三度大胜湖人。詹姆斯-哈登打了27分钟，拿下31分5次助攻，德怀特-霍华德14分15个篮板，克林特-卡佩拉14分11个篮板，特雷沃-阿里扎13分。全队7人得分上双，替补出场的泰-劳森12分。', null);
INSERT INTO `resource` VALUES ('114', '2016-01-18 16:57:20', '2017-01-18 16:57:35', 'b9164c90-2037-48d8-802d-5efb790cadaa', '习近平将访问中东 中国伊朗将签高铁和能源协议', 'xijinpingjiangfangwenzhongdong zhongguoyilangjiangqiangaotiehenengyuanxieyi', null, null, '0', 'c8b2a19bc1f2b34a8ec3cad7290598be', null, null, null, '8', null, '18', null, '2', '1', '1月15日，中国外交部发言人陆慷宣布：应沙特阿拉伯王国国王萨勒曼、阿拉伯埃及共和国总统塞西、伊朗伊斯兰共和国总统鲁哈尼邀请，国家主席习近平将于1月19日至23日对上述三国进行国事访问。', null);
INSERT INTO `resource` VALUES ('115', '2016-02-04 01:21:43', '2017-01-18 16:58:32', 'bd1a783f-39ff-4462-830d-b947d60cea9f', '习近平：按照五个要求建设政法队伍', 'xijinping：anzhaowugeyaoqiujianshezhengfaduiwu', null, null, '0', '5168dcc6c660ee25ed173b4e2971539a', null, null, null, '9', null, '30', null, '2', '1', '再科学的法规也必须有高素质的人来执行，才能成为真正的良法。只有拥有一支优秀的政法队伍，才能实现全面依法治国。怎样培养出素质高、本领硬的 政法队伍？习近平指出：“要按照政治过硬、业务过硬、责任过硬、纪律过硬、作风过硬的要求，努力建设一支信念坚定、执法为民、敢于担当、清正廉洁的政法队 伍。”', null);
INSERT INTO `resource` VALUES ('116', '2016-02-04 01:22:32', '2017-01-18 16:58:31', 'fe91112a-b4a2-4729-8bb4-72a867eb27e8', '习近平：画出最大同心圆', 'xijinping：huachuzuidatongxinyuan', null, null, '0', 'http://cloud.lankr.cn/api/image/c378915b7caa6f5d5227cd7333767da3?m/2/h/500/f/jpg', null, null, null, '10', null, '30', null, '2', '1', '十三五”是全面建成小康社会的决胜阶段，今年是开局之年，开好局、起好步，是取得全面胜利的关键一步。如何开好局并取得最后胜利？2016年1月29日，习近平同党外人士共迎新春时指出：“人心向背、力量对比决定事业成败。我们提出坚持正确处理一致性和多样性关系的方针，就是着眼于形成最大公约数，画出最大的同心圆。”', null);
