INSERT INTO `speaker` VALUES ('8', '2016-02-25 16:43:50', '2016-06-08 13:39:50', '专用讲者', 'zhuanyongjiangzhe', '32134a7e-cbf1-4e40-bda6-0bc30c8600d1', '', null, null, null, 'http://7xo6el.com2.z0.glb.qiniucdn.com/Fjm9Ob5nbJ-a_maw2f7fFhNYAtd7', '16', '1', '主任', '47', '<p>副主任医师，1992年毕业于原上海医科大学临床医学系，同年进入复旦大学附属中山医院普外科工作，1994年考取临床医学研究生，师从我国著名外科学家吴肇光教授和秦新裕教授，从事胰腺和胰岛移植的研究，1999年获得医学博士学位，2001年晋升副主任医师，2002年被批准为硕士生导师。目前是上海普外科学会青年委员，《中华消化病杂志》（英文版）编委。</p>', '1', '1', '1');
